import { Avatar, Box, Button, Typography } from '@mui/material';
import dynamic from 'next/dynamic';
import Head from 'next/head';
import Image from 'next/image';
import React, { useRef } from 'react'
import Loader from '../../components/Loader';
import employeers from "../../../public/WebView/Employeers.png"
import employeersImg from "../../../public/WebView/unsplash_Of_m3hMsoAA.png"
import { useGetAboutQuery } from '../../services/query';
import { getData } from '../../utils/localStorage';
import IsAuthHOC from '../../components/IsAuthHOC'
import { useReactToPrint } from 'react-to-print'
import { Page, Document } from '@react-pdf/renderer'

const LogiCLoseWebLayout = dynamic(
    () => import("../../components/Logiclose/LogiCLoseWebLayout").then((p) => p.default),
    {
        ssr: false,
        loading: () => <Loader />,
    }
);

const AboutComp = ({
    about, isEmployerImage
}) => {
    return (
        <div>
            <Box className='flex flex-col rounded-3xl mt-6 mx-4 p-6 bg-gray-100'>
                <Typography variant='h5' sx={{ color: "#061D2E", fontWeight: 600, fontFamily: "Poppins" }}>
                    About
                </Typography>
                <Typography variant='subtitle2' mt={2} sx={{ color: '#868585', fontFamily: "Poppins", lineHeight: 2 }}>
                    {about ? about.about : `Lorem ipsum dolor sit amet consectetur adipisicing elit. Maxime mollitia,
                        molestiae quas vel sint commodi repudiandae consequuntur voluptatum laborum
                        numquam blanditiis harum quisquam eius sed odit fugiat iusto fuga praesentium
                        optio, eaque rerum! Provident similique accusantium nemo autem. Veritatis
                        obcaecati tenetur iure eius earum ut molestias architecto voluptate aliquam
                        nihil, eveniet aliquid culpa officia aut! Impedit sit sunt quaerat, odit,
                        tenetur error, harum nesciunt ipsum debitis quas aliquid. Reprehenderit,
                        quia. Quo neque error repudiandae fuga? Ipsa laudantium molestias eos
                        sapiente officiis modi at sunt excepturi expedita sint? Sed quibusdam
                        recusandae alias error harum maxime adipisci amet laborum. Perspiciatis
                        minima nesciunt dolorem! Officiis iure rerum voluptates a cumque velit
                    `}
                </Typography>
            </Box>
            <Box className='flex flex-row justify-between w-full pl-6 mt-6 mb-6'>
                <Box className='flex flex-col w-[90%]'>
                    <Typography variant='h5' sx={{ color: "#061D2E", fontWeight: 600, fontFamily: "Poppins" }}>
                        Contacts
                    </Typography>
                    <Box className='flex flex-row my-4 p-6 bg-[#eff6ff]'>
                        <Box className='flex flex-row w-1/2'>
                            <Box className='flex flex-col' sx={{ mr: 4, mt: 4 }}>
                                {about && about.contacts.length > 0 && about.contacts.map((item, idx) =>
                                    item.images[0] !== undefined &&
                                    <Avatar key={idx}
                                        alt={idx}
                                        src={item.images[0]}
                                        sx={{ width: 25, height: 25, mb: 1 }}
                                    />
                                )}
                            </Box>
                            <Box className='flex flex-col'>
                                <Typography variant='subtitle2' sx={{ color: "#469BD3", fontWeight: 600, fontFamily: "Poppins" }}>
                                    Contact names
                                </Typography>
                                {about && about.contacts.length > 0 ?
                                    <Box className='mt-4' sx={{ width: 200 }}>
                                        {about.contacts.map((item, idx) =>
                                            <Typography key={idx} variant='subtitle2' sx={{ mb: 1, color: "#061D2E", fontFamily: "Poppins" }}>
                                                {item.name !== undefined ? item.name.slice(0, 24) : '(name not found)'}
                                            </Typography>
                                        )}
                                    </Box>
                                    :
                                    <Box className='mt-4'>
                                        <Typography variant='subtitle2' sx={{ mb: 1, color: "#061D2E", fontFamily: "Poppins" }}>
                                            no data found
                                        </Typography>
                                    </Box>
                                }
                            </Box>
                        </Box>
                        <Box className='flex flex-col w-1/2'>
                            <Typography variant='subtitle2' sx={{ color: "#469BD3", fontWeight: 600, fontFamily: "Poppins" }}>
                                Contact emails
                            </Typography>
                            {about && about.contacts.length > 0 ?
                                <Box className='flex flex-col mt-4' sx={{ width: 200 }}>
                                    {about.contacts.map((item, idx) =>
                                        <Typography key={idx} variant='subtitle2' sx={{ mb: 1, color: "#061D2E", fontFamily: "Poppins" }}>
                                            {item.email !== undefined ? item.email.slice(0, 24) : '(name not found)'}
                                        </Typography>
                                    )}
                                </Box>
                                :
                                <Box className='mt-4'>
                                    <Typography variant='subtitle2' sx={{ mb: 1, color: "#061D2E", fontFamily: "Poppins" }}>
                                        no data found
                                    </Typography>
                                </Box>
                            }
                        </Box>
                        <Box className='flex flex-col w-1/2'>
                            <Typography variant='subtitle2' sx={{ color: "#469BD3", fontWeight: 600, fontFamily: "Poppins" }}>
                                Contact phones
                            </Typography>
                            {about && about.contacts.length > 0 ?
                                <Box className='mt-4' sx={{ width: 200 }}>
                                    {about.contacts.map((item, idx) =>
                                        <Typography key={idx} variant='subtitle2' sx={{ mb: 1, color: "#061D2E", fontFamily: "Poppins" }}>
                                            {item.contact !== undefined ? item.contact.slice(0, 24) : '(name not found)'}
                                        </Typography>
                                    )}
                                </Box>
                                :
                                <Box className='mt-4'>
                                    <Typography variant='subtitle2' sx={{ mb: 1, color: "#061D2E", fontFamily: "Poppins" }}>
                                        no data found
                                    </Typography>
                                </Box>
                            }
                        </Box>
                    </Box>
                </Box>
                {isEmployerImage &&
                    <Box className='flex flex-row w-8/12 justify-end relative mt-4'>
                        <svg style={{ position: "absolute", top: -20, left: '12%' }} width="118" height="117" viewBox="0 0 118 117" fill="none" xmlns="http://www.w3.org/2000/svg">
                            <circle cx="58.9016" cy="58.5526" r="56.2876" transform="rotate(-123.315 58.9016 58.5526)" stroke="#85BDE2" strokeWidth="4" />
                        </svg>
                        <svg style={{ position: "absolute", top: -20, left: -20 }} width="41" height="41" viewBox="0 0 41 41" fill="none" xmlns="http://www.w3.org/2000/svg">
                            <circle cx="20.9556" cy="20.2174" r="18" transform="rotate(-123.315 20.9556 20.2174)" stroke="#85BDE2" strokeWidth="4" />
                        </svg>
                        <Box sx={{ width: '60%', mt: 2 }}>
                            <Image src={employeers} layout='responsive' />
                        </Box>
                        <Box sx={{ width: '80%', position: "absolute", top: '10%', left: '10%' }}>
                            <Image src={employeersImg} layout='responsive' />
                        </Box>
                    </Box>
                }
            </Box>
        </div>
    )
}

